import { init,  AuthType} from '@thoughtspot/visual-embed-sdk';
import { SearchEmbed } from '@thoughtspot/visual-embed-sdk/react';


function Content(props) {
const {
  settings
} = props
const thoughtspot_URL = "https://se-thoughtspot-cloud.thoughtspot.cloud/#/" 



useEffect(() => {
  console.log(thoughtspot_URL)
  init({
    thoughtSpotHost: thoughtspot_URL,
    authType: AuthType.None,
  });
}, [])

function getAuthToken(){
  return fetch('get_auth_token/')
    .then(response => response.text())
}
const leftMenu = {
  background: settings.primaryColor,
  width: '150px',
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
}
var linkContainers   = settings.links.map(link => (
  <LinkContainer
    key={link}
    id={link}
    name={settings.linkNames[link]}
    content={settings.linkContents[link]}
    type={settings.linkTypes[link]}
  />
));

return (
  <div id="container">
      <div style={leftMenu}>
          <img className="logoImage" src={settings.logoImage}></img>
      {linkContainers}
      </div>
      <div id="TSContainer">
        <SearchEmbed frameParams={{width:'100%',height:'100vh'}}

        />
      </div>
  </div>
)
}
